function storeReducer() {

  const dataStore = [
    {
      id: 1,
      name: 'canceled'
    },
    {
      id: 2,
      name: 'draft'
    },
    {
      id: 3,
      name: 'with pickup'
    },
    {
      id: 4,
      name: 'printed'
    }
  ]
  return dataStore
}

export default storeReducer;
